import { Component } from '@angular/core';
import { StaffMasterSearchModel } from '../../Models/StaffMasterDataModel';
import { SSOLoginDataModel } from '../../Models/SSOLoginDataModel';
import { CommonFunctionService } from '../../Services/CommonFunction/common-function.service';
import { LoaderService } from '../../Services/Loader/loader.service';
import { StaffMasterService } from '../../Services/StaffMaster/staff-master.service';
import { ToastrService } from 'ngx-toastr';
import { ActivatedRoute, Router } from '@angular/router';
import { StaffDashService } from '../../Services/StaffDashboard/staff-dashboard.service';

@Component({
  selector: 'app-staff-dash-report',
  templateUrl: './staff-dash-report.component.html',
  styleUrls: ['./staff-dash-report.component.css']
})
export class StaffDashReportComponent {
  public searchRequest = new StaffMasterSearchModel();
  public StateMasterList: any = [];
  public RoleMasterList: any = [];
  public DesignationMasterList: any = [];
  public BranchesMasterList: any = [];
  public SubjectMasterDDL: any = [];
  public DistrictMasterList: any = [];
  public sSOLoginDataModel = new SSOLoginDataModel();
  public stateID: number = 0;
  public StaffMasterList: any = [];
  public Table_SearchText: string = "";
  public Id: any | null = null;
  public InstituteList: any = []
  public StaffTypeList: any = []
  constructor(
    private commonMasterService: CommonFunctionService,
    private loaderService: LoaderService,
    private staffMasterService: StaffDashService,
    private activatedRoute: ActivatedRoute,
    private toastr: ToastrService,
  ) { }

  async ngOnInit() {
    this.Id = (this.activatedRoute.snapshot.paramMap.get('id')?.toString())?.split('=')[1];
    this.sSOLoginDataModel = await JSON.parse(String(localStorage.getItem('SSOLoginUser')));
    // this.Id = Number(this.activatedRoute.snapshot.queryParamMap.get('id')?.toString());//student list key
    this.GetStateMaterData();
    this.GetRoleMasterData();
    this.GetDesignationMasterData();
    this.GetBranchesMasterData();
    this.GetSubjectMasterDDL();
    await this.GetAllData();
  }

  async GetStateMaterData() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.GetStateMaster()
        .then((data: any) => {
          data = JSON.parse(JSON.stringify(data));
          console.log(data['Data']);
          this.StateMasterList = data['Data'];
          console.log(this.StateMasterList);
        }, error => console.error(error));
    }
    catch (Ex) {
      console.log(Ex);
    }
    finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async GetInstituteMasterData() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.InstituteMaster(this.sSOLoginDataModel.DepartmentID).then((data: any) => {
        data = JSON.parse(JSON.stringify(data));
        this.InstituteList = data.Data;
        console.log("InstituteList", this.InstituteList);
      })
    } catch (error) {
      console.error(error);
    } finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async GetStaffTypeData() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.GetStaffTypeDDL().then((data: any) => {
        data = JSON.parse(JSON.stringify(data));
        this.StaffTypeList = data.Data;
        console.log("StaffTypeList", this.StaffTypeList);
      })
    } catch (error) {
      console.error(error);
    } finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async ddlState_Change() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.DistrictMaster_StateIDWise(this.searchRequest.StateID)
        .then((data: any) => {
          data = JSON.parse(JSON.stringify(data));
          this.DistrictMasterList = data['Data'];
        }, error => console.error(error));
    }
    catch (Ex) {
      console.log(Ex);
    }
    finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async GetRoleMasterData() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.GetRoleMasterDDL().then((data: any) => {
        data = JSON.parse(JSON.stringify(data));
        this.RoleMasterList = data.Data;
        console.log("RoleMasterList", this.RoleMasterList);
      })
    } catch (error) {
      console.error(error);
    } finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async GetDesignationMasterData() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.GetDesignationMaster().then((data: any) => {
        data = JSON.parse(JSON.stringify(data));
        this.DesignationMasterList = data.Data;
        console.log("DesignationMasterList", this.DesignationMasterList);
      }, error => console.error(error))
    } catch (error) {
      console.error(error);
    } finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async GetBranchesMasterData() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.StreamMaster().then((data: any) => {
        data = JSON.parse(JSON.stringify(data));
        this.BranchesMasterList = data.Data;
        console.log("StreamMasterList", this.BranchesMasterList);
      })
    } catch (error) {
      console.error(error);
    } finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async GetSubjectMasterDDL() {
    try {
      this.loaderService.requestStarted();
      await this.commonMasterService.GetSubjectMasterDDL().then((data: any) => {
        data = JSON.parse(JSON.stringify(data));
        this.SubjectMasterDDL = data.Data;
        console.log("SubjectMasterList", this.SubjectMasterDDL);
      })
    } catch (error) {
      console.error(error);
    } finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async GetAllData() {
    try {
      this.loaderService.requestStarted();
      this.searchRequest.StaffID = this.Id
      await this.staffMasterService.GetDashReport(this.searchRequest)
        .then((data: any) => {
          data = JSON.parse(JSON.stringify(data));
          console.log(data);
          this.StaffMasterList = data['Data'];
          console.log(this.StaffMasterList)
        }, (error: any) => console.error(error)
        );
    }
    catch (ex) {
      console.log(ex);
    }
    finally {
      setTimeout(() => {
        this.loaderService.requestEnded();
      }, 200);
    }
  }

  async ClearSearchData() {
    this.searchRequest = new StaffMasterSearchModel();
    this.searchRequest.StateID = 0;
    this.DistrictMasterList = [];
    await this.GetAllData();
  }

  //async DeleteById(PlacementCompanyID: number) {
  //  this.Swal2.Confirmation("Do you want to delete?",
  //    async (result: any) => {
  //      //confirmed
  //      if (result.isConfirmed) {
  //        try {
  //          //Show Loading
  //          this.loaderService.requestStarted();

  //          await this.staffMasterService.DeleteById(PlacementCompanyID, this.sSOLoginDataModel.UserID)
  //            .then(async (data: any) => {
  //              data = JSON.parse(JSON.stringify(data));
  //              console.log(data);

  //              if (!data.State) {
  //                this.toastr.success(data.SuccessMessage)
  //                //reload
  //                await this.GetAllData();
  //              }
  //              else {
  //                this.toastr.error(data.ErrorMessage)
  //              }

  //            }, (error: any) => console.error(error)
  //            );
  //        }
  //        catch (ex) {
  //          console.log(ex);
  //        }
  //        finally {
  //          setTimeout(() => {
  //            this.loaderService.requestEnded();
  //          }, 200);
  //        }
  //      }
  //    });


}


<!-- Page Title Start -->
<app-loader></app-loader>
<div class="flex items-center justify-between flex-wrap gap-2 mb-6">
  <div>
    <h4 class="text-slate-900 text-lg font-medium mb-2">Staff List</h4>

    <div class="md:flex hidden items-center gap-3 text-sm font-semibold">
      <a href="#" class="text-sm font-medium text-slate-700">Masters</a>
      <i class="material-symbols-rounded text-xl flex-shrink-0 text-slate-500">chevron_right</i>
      <a href="/addstaffmaster" class="text-sm font-medium text-slate-700" aria-current="page">Staff List</a>
    </div>
  </div>
</div>
<!-- Page Title End -->

<div class="card">
  <div class="card-body p-5">
    <div class="mb-8">
      <div class="flex justify-between flex-wrap items-center mb-3 p-3 py-2 bg-light">
        <b class="text-1xl-5"><i class="ti ti-search"></i> Enter Search Criteria</b>
        <!--<a href="#" class="btn bg-success btn-sm text-white"><i class="ti ti-plus"></i>Add New</a>-->
      </div>
      <div class="grid 2xl:grid-cols-4 xl:grid-cols-4 lg:grid-cols-3 md:grid-cols-2 grid-cols-1 gap-3">
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">Staff Type</label>
          <select class="form-select" name="SearchByStaffType" id="SearchByStaffType"
                  [(ngModel)]="searchRequest.StaffTypeID">
            <option value="0">Choose Option</option>
            <option value="1">Teaching</option>
            <option value="2">Non-Teaching</option>
          </select>
        </div>
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">Role</label>
          <select class="form-select" name="SearchByStaffRole" id="SearchByStaffRole"
                  [(ngModel)]="searchRequest.RoleID">
            <option value="0">Choose Option</option>
            <option *ngFor="let item of RoleMasterList" [value]="item.ID">{{item.Name}}</option>
          </select>
        </div>
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">State</label>
          <select class="form-select" name="SearchByState" id="SearchByState"
                  [(ngModel)]="searchRequest.StateID" (change)="ddlState_Change()">
            <option value="0">Choose Option</option>
            <option *ngFor="let item of StateMasterList" [value]="item.ID">{{item.Name}}</option>
          </select>
        </div>
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">District</label>
          <select class="form-select" name="SearchByDistrict" id="SearchByDistrict"
                  [(ngModel)]="searchRequest.DistrictID">
            <option value="0">Choose Option</option>
            <option *ngFor="let item of DistrictMasterList" [value]="item.ID">
              {{item.Name}}
            </option>
          </select>
        </div>
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">College</label>
          <select class="form-select" name="SearchByCollege" id="SearchByCollege"
                  [(ngModel)]="searchRequest.InstituteID">
            <option value="0">Choose Option</option>
            <option value="1">College 1</option>
            <option value="2">College 2</option>
          </select>
        </div>
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">Course</label>
          <select class="form-select" name="SearchByCourse" id="SearchByCourse"
                  [(ngModel)]="searchRequest.CourseID">
            <option value="0">Choose Option</option>
            <option *ngFor="let item of BranchesMasterList" [value]="item.StreamID">
              {{item.StreamName}}
            </option>
          </select>
        </div>
        <div>
          <label class="text-gray-800 text-sm font-medium inline-block mb-1">Subject</label>
          <select class="form-select" name="SearchBySubject" id="SearchBySubject"
                  [(ngModel)]="searchRequest.SubjectID">
            <option value="0">Choose Option</option>
            <option *ngFor="let item of SubjectMasterDDL" [value]="item.ID">{{item.Name}}</option>
          </select>
        </div>

      </div>
      <div class="grid 2xl:grid-cols-1 xl:grid-cols-1 lg:grid-cols-1 md:grid-cols-1 grid-cols-1 gap-3 mt-3">
        <div class="text-center">
          <button type="button" class="btn bg-info text-white" (click)="GetAllData()">Search</button>
          <button type="button" class="btn bg-danger text-white" (click)="ClearSearchData()">Cancel</button>
        </div>

      </div>


    </div>
    <div class="flex justify-between flex-wrap items-center mb-3 p-3 py-2 bg-light">
      <b class="text-1xl-5"><i class="ti ti-list"></i> Search Results</b>
    </div>
    <div class="grid 2xl:grid-cols-4 xl:grid-cols-4 lg:grid-cols-3 md:grid-cols-2 grid-cols-1 gap-3">
      <div class="">
        <select id="ddlConter" class="form-select  couterDropDown">
          <option value="50">50</option>
          <option value="100">100</option>
          <option value="500">500</option>
          <option value="1000">1000</option>
        </select>
      </div>
      <div class="">
      </div>
      <div class="">
      </div>
      <div class="">
        <input class="form-input" placeholder="Search..." [(ngModel)]="Table_SearchText" />
      </div>
    </div>
    <div class="overflow-x-auto mt-3">
      <table class="table table-border w-full table-auto" cellpadding="5">
        <thead class="bg-light/40 border-b border-gray-100 dark:bg-light/5 dark:border-b-gray-700 h-10">
          <tr>
            <th class="text-left">Sr. No.</th>
            <th class="text-left">Staff Type</th>
            <th class="text-left">Name/SSO Id</th>
            <th class="text-left">Course</th>
            <th class="text-left">Subject</th>
            <th class="text-left">Contact Details</th>
            <th class="text-left">Address Details</th>
            <th class="text-left">Profile Status</th>
     
          </tr>
        </thead>
        <tbody>

          <tr *ngFor="let row of StaffMasterList | tableSearchFilter:Table_SearchText;let idx=index;">
            <td>{{idx+1}}</td>
            <td>{{row.StaffType}}</td>
            <td>{{row.Name}} {{row.SSOID}}</td>
            <td>{{row.Stream}}</td>
            <td>{{row.Subject}}</td>
            <td>
              <p><i class="ti ti-phone"></i> {{row.MobileNumber}}</p>
              <p><i class="ti ti-mail"></i> {{row.Email}}</p>
            </td>
            <td>
              <p style="max-width:350px">
                {{row.Address}}, {{row.District}}, {{row.State}}, {{row.PinCode}}
              </p>
            </td>
            <td>
              <span class="py-1 px-2 bg-danger text-white">Pending</span>
            </td>
            <!--<td>
              <div class="flex align-center justify-center actionBtns w-auto"
                   style="width:auto !important">
                <a href="addstaffmaster?id={{row.StaffID}}" title="Edit"><i class="ti ti-pencil"></i></a>
              </div>
            </td>-->
          </tr>

        </tbody>
      </table>

    </div>

  </div>
</div>
